import Square from "./Square";

function BoardRow(props) {
    const tracker = [0,1,2,3,4,5,6,7,8];
    return (
        <div className="row Board-row" id={props.number}>
            {tracker.map((data) => {

                const temp = data+props.id;
                <Square color="blue" id={"Square" +temp}/>
            })}
        </div>
    )
}
export default BoardRow;
